import React, { useState } from "react";

import Dashboard from "./Dashboard";
import Navbar from "./Navbar";
function App() {
  const [currentPage, setCurrentPage ] = useState("Dashboard");

  switch(currentPage){
    case "Dashboard": 
    <Dashboard />;
  }
  return (
    <div>
      <Dashboard />
      <Navbar currentPage={currentPage} setCurrentPage={setCurrentPage} />

    </div>
  );
}

export default App;
